import React, { useState } from 'react';

function WeddingPlanningForm() {
    const [formData, setFormData] = useState({
        fullName: '',
        contactNumber: '',
        email: '',
        weddingDate: '',
        weddingLocation: '',
        eventType: '',
        brideDetails: {
            name: '',
            age: '',
            religion: '',
            culture: '',
        },
        groomDetails: {
            name: '',
            age: '',
            religion: '',
            culture: '',
        },
        weddingTheme: '',
        colorScheme: '',
        decorStyle: '',
        venueType: '',
        venueSize: '',
        specialRequirements: '',
        vendorPreferences: {
            photography: false,
            catering: false,
            entertainment: false,
        },
        guestList: {
            numberOfGuests: '',
            vipGuests: '',
            accommodation: '',
        },
        budget: {
            venueBudget: '',
            decorBudget: '',
            cateringBudget: '',
            totalBudget: '',
        },
        additionalServices: '',
        consultationDate: '',
        consultationTime: '',
        additionalNotes: '',
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevState) => ({
            ...prevState,
            [name]: value,
        }));
    };

    const handleBrideGroomChange = (e, person) => {
        const { name, value } = e.target;
        setFormData((prevState) => ({
            ...prevState,
            [person]: {
                ...prevState[person],
                [name]: value,
            },
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Process form data
        console.log(formData);
    };

    return (
        <div className="wedding-planning-form">
            <h2>Wedding Planning Form</h2>
            <form onSubmit={handleSubmit}>
                {/* Basic Details */}
                <div className="form-section">
                    <h3>Basic Details</h3>
                    <input
                        type="text"
                        name="fullName"
                        value={formData.fullName}
                        onChange={handleInputChange}
                        placeholder="Full Name"
                    />
                    <input
                        type="tel"
                        name="contactNumber"
                        value={formData.contactNumber}
                        onChange={handleInputChange}
                        placeholder="Contact Number"
                    />
                    <input
                        type="email"
                        name="email"
                        value={formData.email}
                        onChange={handleInputChange}
                        placeholder="Email Address"
                    />
                    <input
                        type="date"
                        name="weddingDate"
                        value={formData.weddingDate}
                        onChange={handleInputChange}
                    />
                    <input
                        type="text"
                        name="weddingLocation"
                        value={formData.weddingLocation}
                        onChange={handleInputChange}
                        placeholder="Wedding Location"
                    />
                    <input
                        type="text"
                        name="eventType"
                        value={formData.eventType}
                        onChange={handleInputChange}
                        placeholder="Event Type"
                    />
                </div>

                {/* Bride and Groom Details */}
                <div className="form-section">
                    <h3>Bride Details</h3>
                    <input
                        type="text"
                        name="name"
                        value={formData.brideDetails.name}
                        onChange={(e) => handleBrideGroomChange(e, 'brideDetails')}
                        placeholder="Bride Name"
                    />
                    <input
                        type="number"
                        name="age"
                        value={formData.brideDetails.age}
                        onChange={(e) => handleBrideGroomChange(e, 'brideDetails')}
                        placeholder="Age"
                    />
                    <input
                        type="text"
                        name="religion"
                        value={formData.brideDetails.religion}
                        onChange={(e) => handleBrideGroomChange(e, 'brideDetails')}
                        placeholder="Religion"
                    />
                    <input
                        type="text"
                        name="culture"
                        value={formData.brideDetails.culture}
                        onChange={(e) => handleBrideGroomChange(e, 'brideDetails')}
                        placeholder="Culture"
                    />
                    
                    <h3>Groom Details</h3>
                    <input
                        type="text"
                        name="name"
                        value={formData.groomDetails.name}
                        onChange={(e) => handleBrideGroomChange(e, 'groomDetails')}
                        placeholder="Groom Name"
                    />
                    <input
                        type="number"
                        name="age"
                        value={formData.groomDetails.age}
                        onChange={(e) => handleBrideGroomChange(e, 'groomDetails')}
                        placeholder="Age"
                    />
                    <input
                        type="text"
                        name="religion"
                        value={formData.groomDetails.religion}
                        onChange={(e) => handleBrideGroomChange(e, 'groomDetails')}
                        placeholder="Religion"
                    />
                    <input
                        type="text"
                        name="culture"
                        value={formData.groomDetails.culture}
                        onChange={(e) => handleBrideGroomChange(e, 'groomDetails')}
                        placeholder="Culture"
                    />
                </div>

                {/* Additional Sections */}
                {/* Add the rest of the fields for Wedding Theme, Vendor Preferences, Budget, etc. */}
                <div className="form-section">
                    <button type="submit">Submit</button>
                </div>
            </form>
        </div>
    );
}

export default WeddingPlanningForm;
